import React, { Component } from 'react'
import './Navbar.css';
import Modal from '../modal/Modal';

export default class Navbar extends Component {
    constructor(props) {
        super(props)

        this.state = {
            registerOpen: true,
            loginOpen: false
        }
    }

    render() {
        const { registerOpen, loginOpen } = this.state;
        const wrapperClass = loginOpen || registerOpen ? "wrapper show" : "wrapper hide";
        const wrapper = (<div className={wrapperClass} onClick={() => this.setState({ registerOpen: false, loginOpen: false })}></div>);
        return (
            <div className="navbar">
                <div className="">
                    <h1> {`<News Tracking/>`} </h1>
                </div>
                <div className="utils">
                    <p onClick={() => this.setState({ registerOpen: true })}> Register </p>
                    <p onClick={() => this.setState({ loginOpen: true })}> Login </p>
                </div>
                {
                    registerOpen && <Modal title={'Register'} content={<h1>hello</h1>} />
                }
                {
                    loginOpen && <Modal title={'Login'} content={<h1>hello</h1>} />
                }
                {
                    (loginOpen || registerOpen) && wrapper
                }
            </div>
        );
    }
}
